import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Nav from './components/NavBar';

function App() {
  return (
    <BrowserRouter>
      <div>
        <Nav />
      </div>
    </BrowserRouter>
  );
}

export default App;

